import { useState } from 'react';
import Counter from './Counter';

function App() {

  const [count, setCount] = useState(0);

  const addCount = () => {
    setCount(count + 1);
  }
  return (
    <div >
      <h1>React App</h1>

      <Counter title="1st Counter" count={count}/>
      <Counter title="1s Counter" count={count}/>
      <button  onClick={addCount}>Increment</button>

    </div>
  );
}

export default App;
